module.exports = {
  root: true,
  env: {
    node: true
  },
  extends: [
    'plugin:vue/vue3-essential',
    '@vue/standard',
    '@vue/typescript/recommended'
  ],
  parserOptions: {
    ecmaVersion: 2020
  },
  rules: {
    '@typescript-eslint/no-explicit-any': 'off',
    '@typescript-eslint/camelcase': 'off',
    '@typescript-eslint/no-namespace': 'off',
    '@typescript-eslint/no-non-null-assertion': 'off',
    '@typescript-eslint/explicit-module-boundary-types': 'off',
    '@typescript-eslint/ban-types': 'off',
    '@typescript-eslint/no-extra-non-null-assertion': 'off',
    '@typescript-eslint/no-unused-vars': 'warn',
    'standard/no-callback-literal': 'off',
    'no-console': 'off',
    'no-debugger': process.env.NODE_ENV === 'production' ? 'warn' : 'off',
    'comma-dangle': 'off',
    'multiline-ternary': 'off',
    'node/no-callback-literal': 'off',
    'no-unused-expressions': 'off',
    'vue/multi-word-component-names': 'off',
  },
  overrides: [
    {
      files: [
        '**/__tests__/*.{j,t}s?(x)',
        '**/tests/unit/**/*.spec.{j,t}s?(x)'
      ],
      env: {
        mocha: true
      }
    }
  ]
}

module.exports = {
  extends: ['@commitlint/config-conventional'],
};

{
  "appId": "yank.note",
  "productName": "Yank Note",
  "copyright": "Copyright 2018-2021 purocean@outlook.com",
  "asar": true,
  "asarUnpack": [
    "bin/**/*",
    "help/**/*",
    "dist/main/resources/**/*",
    "node_modules/fsevents/**/*",
    "node_modules/node-pty/**/*",
    "node_modules/@vscode/ripgrep/**/*"
  ],
  "files": [
    "./bin/**",
    "./help/**",
    "./dist/**",
    "!node_modules/plantuml-pipe/vendor/*"
  ],
  "artifactName": "Yank-Note-${os}-${arch}-${version}.${ext}",
  "directories": {
    "output": "./out/"
  },
  "npmRebuild": false,
  "win": {
    "target": [
      "zip",
      "nsis"
    ],
    "icon": "./build/icon.ico"
  },
  "linux": {
    "executableName": "yank-note",
    "category": "Markdown",
    "maintainer": "purocean <purocean@outlook.com>",
    "icon": "./build/icon.icns",
    "target": [
      "deb",
      "AppImage"
    ]
  },
  "mac": {
    "icon": "./build/icon.icns",
    "gatekeeperAssess": false,
    "hardenedRuntime": true,
    "entitlements": "build/entitlements.mac.plist",
    "entitlementsInherit": "build/entitlements.mac.plist",
    "binaries": [
      "out/mac/Yank Note.app/Contents/Resources/app.asar.unpacked/bin/darwin-pandoc-2.14.2"
    ],
    "target": [
      "dmg",
      "zip"
    ]
  },
  "afterSign": "scripts/notarize.js",
  "nsis": {
    "perMachine": false
  },
  "fileAssociations": [
    {
      "ext": "md",
      "name": "Markdown File",
      "description": "Markdown File",
      "role": "Editor"
    }
  ]
}

module.exports = {
  preset: 'ts-jest',
  testEnvironment: 'node',
  setupFilesAfterEnv: [
    'jest-extended'
  ],
  coveragePathIgnorePatterns: [
  ],
  moduleNameMapper: {
    '@/(.*)': '<rootDir>/src/$1',
    '@share/(.*)': '<rootDir>/src/share/$1',
    '@main/(.*)': '<rootDir>/src/main/$1',
    '@fe/(.*)': '<rootDir>/src/renderer/$1',
    "^lodash-es$": "lodash"
  }
};

module.exports = {
  plugins: [
    require('autoprefixer')
  ]
}

import { defineConfig } from 'vite'
import vue from '@vitejs/plugin-vue'
import vueJsx from '@vitejs/plugin-vue-jsx'
import path from 'path'
import fs from 'fs-extra'

// copy vs
const vsDist = path.resolve(__dirname, 'src/renderer/public/vs')
if (!fs.existsSync(vsDist)) {
  fs.copySync(
    path.resolve(__dirname, 'node_modules/monaco-editor/min/vs'),
    vsDist
  )
}

// https://vitejs.dev/config/
export default defineConfig({
  plugins: [vue(), vueJsx()],
  root: 'src/renderer',
  define: {
    __APP_VERSION__: JSON.stringify(process.env.npm_package_version)
  },
  server: {
    port: 8066,
    proxy: {
      '/static': {
        target: 'http://127.0.0.1:3044'
      },
      '/custom-css': {
        target: 'http://127.0.0.1:3044'
      },
      '/extension': {
        target: 'http://127.0.0.1:3044'
      },
      '/github.css': {
        target: 'http://127.0.0.1:3044'
      },
      '/api': {
        target: 'http://127.0.0.1:3044'
      },
      '/ws': {
        target: 'http://127.0.0.1:3044',
        ws: true
      }
    }
  },
  resolve: {
    alias: [
      { find: /^semver$/, replacement: path.resolve(__dirname, 'src/renderer/others/semver.js') },
      { find: /^socket.io-client$/, replacement: 'socket.io-client/dist/socket.io.js' },
      { find: /^vue$/, replacement: 'vue/dist/vue.esm-bundler.js' },
      { find: /^@\//, replacement: path.resolve(__dirname, 'src') + '/' },
      { find: /^@fe\//, replacement: path.resolve(__dirname, 'src', 'renderer') + '/' },
      { find: /^@share\//, replacement: path.resolve(__dirname, 'src', 'share') + '/' },
    ]
  },
  build: {
    outDir: '../../dist/renderer',
    emptyOutDir: true,
    rollupOptions: {
      input: {
        main: path.resolve(__dirname, 'src/renderer/index.html'),
        embed: path.resolve(__dirname, 'src/renderer/embed/index.html')
      }
    }
  }
})
